INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 11300101, 10, 1, 1, 3.18, 4, 8, 1, 10, "vo_minigame_1012_result_1000", "フフ、全問正解よ！\nちゃんと勉強してるみたいで\n感心だわ♪");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300102, 10, 1, 1, 3.33, 10, 7, 1, 10, "vo_minigame_1012_result_1001", "すごいじゃない…全問正解よ！\nま、当然といや当然よね～\nだってあたしが\n教えてやってんだから♪");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300103, 10, 1, 1, 5.41, 10, 1, 1, 10, "vo_minigame_1012_result_1002", "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 11300104, 10, 1, 1, 8.11, 10, 8, 2, 10, "vo_minigame_1012_result_1003", "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 10, 11300105, 10, 1, 1, 1.31, 0, 5, 2, 10, "vo_minigame_1012_result_1004", "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 11300106, 10, 1, 1, 4.93, 0, 8, 2, 10, "vo_minigame_1012_result_1005", "ここまで完璧に正解されちゃうと\nちょっと悔しいわね…！\nけど素直に褒めてやるわ！\nえらい、えらい、えら～い！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 11300107, 10, 1, 1, 2.99, 4, 8, 3, 10, "vo_minigame_1012_result_1006", "すごい…あんたパーフェクトよ！\nこのままいけば次の試験、\n学年一位も夢じゃないかもね！\n楽しみだわ～♪");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300108, 10, 1, 1, 8.37, 4, 7, 3, 10, "vo_minigame_1012_result_1007", "満点よ！　フフ、もうあんたに\n教えることはなにもないわ…！\n逆にあたしがあんたに教わりたい\nくらいよ！　…ね、先生♪");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 11300109, 10, 1, 1, 5.32, 8, 5, 3, 10, "vo_minigame_1012_result_1008", "全・問・正・解！\n超難問揃いなのにすごいわね…！\nもしかしてだけど、\nあんたって天才！？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 11300110, 9, 1, 1, 4.77, 4, 1, 1, 7, "vo_minigame_1012_result_1009", "お、かなりいい点数ね～！\nあたしも教えがいがあるわ♪\nさ、まだまだ勉強するわよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300111, 9, 1, 1, 2.97, 4, 7, 1, 7, "vo_minigame_1012_result_1010", "うん、いい感じで点取れてるわ！\nこの調子で次は、\n満点を見せてほしいわね！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 11300112, 9, 1, 1, 3.47, 0, 1, 1, 7, "vo_minigame_1012_result_1011", "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300113, 9, 1, 1, 5.32, 4, 7, 2, 7, "vo_minigame_1012_result_1012", "すごい、かなりできてるわよ！\n難しい問題なのにやるじゃない！\nあとは目指せ、満点ね！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300114, 9, 1, 1, 6.49, 10, 7, 2, 7, "vo_minigame_1012_result_1013", "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 11300115, 9, 1, 1, 3.56, 0, 1, 2, 7, "vo_minigame_1012_result_1014", "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300116, 9, 1, 1, 5.67, 10, 1, 3, 7, "vo_minigame_1012_result_1015", "うん、ほとんど正解よ！\nこんな難しい問題なのに、\nすごいじゃない！\nやっぱりあんた只者じゃないわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 11300117, 9, 1, 1, 2.85, 10, 1, 3, 7, "vo_minigame_1012_result_1016", "着実に成長してるって感じね？\nあんたならこの難問でも、\nいつか満点取れちゃうかも…！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 11300118, 9, 1, 1, 3.88, 0, 1, 3, 7, "vo_minigame_1012_result_1017", "うわー惜しいわね！\nもうちょっとで満点よ？\nま、あたしでも悩む難問だから、\nこの点数は胸を張っていいわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300119, 6, 1, 1, 4.12, 0, 1, 1, 4, "vo_minigame_1012_result_1018", "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 11300120, 6, 1, 1, 4.34, 0, 1, 1, 4, "vo_minigame_1012_result_1019", "んーはっきり言っちゃうと\n中途半端な点数ね…\nまあいいわ！こっからガンガン\n点数上げていくわよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300121, 6, 1, 1, 3.15, 0, 1, 1, 4, "vo_minigame_1012_result_1020", "う～ん、正直物足りない点数ね！\nあんたには期待してんだから、\nもっと頑張んなさい！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 11300122, 6, 1, 1, 5.3, 0, 1, 2, 4, "vo_minigame_1012_result_1021", "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300123, 6, 1, 1, 2.55, 0, 1, 2, 4, "vo_minigame_1012_result_1022", "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 1, 11300124, 6, 1, 1, 4.19, 0, 7, 2, 4, "vo_minigame_1012_result_1023", "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 11300125, 6, 1, 1, 3.43, 0, 1, 3, 4, "vo_minigame_1012_result_1024", "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 1, 11300126, 6, 1, 1, 0.0, 0, 1, 3, 4, "vo_minigame_1012_result_1025", "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300127, 6, 1, 1, 3.72, 0, 7, 3, 4, "vo_minigame_1012_result_1026", "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300128, 3, 1, 1, 3.5, 1, 2, 1, 1, "vo_minigame_1012_result_1027", "なるほど…\nこれは教えがいがあるわね\nビシバシ鍛えてやるから\n覚悟しなさい！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 11300129, 3, 1, 1, 3.25, 1, 2, 1, 1, "vo_minigame_1012_result_1028", "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300130, 3, 1, 1, 4.62, 0, 2, 1, 1, "vo_minigame_1012_result_1029", "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 11300131, 3, 1, 1, 4.5, 0, 1, 2, 1, "vo_minigame_1012_result_1030", "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300132, 3, 1, 1, 0.01, 9, 3, 2, 1, "vo_minigame_1012_result_1031", "んー結構ミスっちゃってるわね…\nこのまま続けるのもいいけど、\n簡単な問題からやり直すのも\nありかもよ～？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 11300133, 3, 1, 1, 0.01, 9, 9, 2, 1, "vo_minigame_1012_result_1032", "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300134, 3, 1, 1, 0.01, 6, 3, 3, 1, "vo_minigame_1012_result_1033", "うーん、残念な結果ね…\n超難問だから仕方ないけど\n無理せず簡単な問題から挑戦\nしてもいいかもよ？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300135, 3, 1, 1, 2.97, 0, 9, 3, 1, "vo_minigame_1012_result_1034", "正解率はかなり悪いわね…\nまあ難しい問題だもんね…！\nそのチャレンジ精神は買うわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300136, 3, 1, 1, 3.1, 0, 1, 3, 1, "vo_minigame_1012_result_1035", "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 6, 11300137, 0, 1, 1, 4.31, 1, 2, 1, 0, "vo_minigame_1012_result_1036", "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 2, 11300138, 0, 1, 1, 0.1, 1, 2, 1, 0, "vo_minigame_1012_result_1037", "０点って…\nあんたふざけてんの！？\nちゃんとやらないなら\n電撃魔法くらわせるわよ！？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 11300139, 0, 1, 1, 4.23, 9, 3, 1, 0, "vo_minigame_1012_result_1038", "もしかしたらあんたは\n勉強向いてないのかもね…\n…勉強だけがすべてじゃないわ\n違うとこで頑張りましょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 11300140, 0, 1, 1, 4.38, 0, 2, 2, 0, "vo_minigame_1012_result_1039", "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 11300141, 0, 1, 1, 3.58, 0, 2, 2, 0, "vo_minigame_1012_result_1040", "あんたの点数は～～…\n…はい！　０てーん！！\n…って、ふざけんなーー！！！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 11300142, 0, 1, 1, 2.02, 1, 2, 2, 0, "vo_minigame_1012_result_1041", "０点ってどういうこと！？\nいやあんた、逆にすごいわよ！？\n目つぶってやったとしても\n１点は取れるから！");
