INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 1, 12300102, -1, 1, 2, 3.85, 0, 9, 1, 20, "vo_minigame_1012_result_1046", "なによあんた、走り出したペンが\n止まらないって感じ？\nったくシンプルにすごいじゃない\n花丸あげるわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 12300103, -1, 1, 2, 0.01, 8, 5, 1, 20, "vo_minigame_1012_result_1047", "すごい点数ね…！\nあんた勉強してないとか言って\nホントはめちゃくちゃやってる\nパターンのやつね！？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 12300104, -1, 1, 2, 2.86, 4, 7, 2, 20, "vo_minigame_1012_result_1048", "勉強の成果、\nちゃんとでてんじゃない！\nあたしもあんたの先生として、\n鼻が高いわ～♪");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 12300105, -1, 1, 2, 2.02, 9, 3, 2, 20, "vo_minigame_1012_result_1049", "オッケー！　もう十分よ！\nこれ以上でき過ぎちゃったら、\nあたしが教える必要なくなるわ！");
