INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 12300107, -1, 1, 2, 6.85, 7, 4, 3, 20, "vo_minigame_1012_result_1051", "すごいすごいとは思ってたけど、\nあんた勉強も完璧なの…？\nそりゃみんなあんたに惚れ…\nや、な、なんでもない！！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 12300108, -1, 1, 2, 3.79, 0, 9, 3, 20, "vo_minigame_1012_result_1052", "この問題、あたしでも悩む\n超難問なのに…\nふふっ、もう褒めるしかないわ！\n大変よくできました！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 12300109, -1, 1, 2, 0.01, 7, 4, 3, 20, "vo_minigame_1012_result_1053", "別に顔赤くなんてなってない！\n頭がいい人が好きとか…\nかっこいいとか…\n…思ってないからね！");
