INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 1, 12300135, 14, 1, 2, 0.0, 0, 1, 2, 10, "vo_minigame_1012_result_1071", "難しい問題でも基礎は大事よ！\nこの調子でどんどん\n点数上げていきましょう！");
