INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 1, 12300146, 9, 1, 2, 4.24, 0, 7, 1, 5, "vo_minigame_1012_result_1078", "ふ～ん、まあまあの出来だわ\n悪くはないんだけど…あんたには\nもっともっと期待してるわ～");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 12300147, 9, 1, 2, 4.74, 0, 1, 1, 5, "vo_minigame_1012_result_1079", "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 1, 12300148, 9, 1, 2, 0.0, 0, 1, 1, 5, "vo_minigame_1012_result_1080", "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 12300149, 9, 1, 2, 2.21, 0, 1, 2, 5, "vo_minigame_1012_result_1081", "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300150, 9, 1, 2, 2.46, 0, 1, 2, 5, "vo_minigame_1012_result_1082", "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300151, 9, 1, 2, 2.94, 0, 1, 2, 5, "vo_minigame_1012_result_1083", "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 12300152, 9, 1, 2, 4.19, 0, 1, 3, 5, "vo_minigame_1012_result_1084", "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 1, 12300153, 9, 1, 2, 0.0, 0, 1, 3, 5, "vo_minigame_1012_result_1085", "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300154, 9, 1, 2, 2.63, 0, 1, 3, 5, "vo_minigame_1012_result_1086", "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300155, 4, 1, 2, 5.53, 0, 1, 1, 1, "vo_minigame_1012_result_1087", "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300156, 4, 1, 2, 0.01, 9, 3, 1, 1, "vo_minigame_1012_result_1088", "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300157, 4, 1, 2, 4.15, 3, 1, 1, 1, "vo_minigame_1012_result_1089", "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 12300158, 4, 1, 2, 0.01, 9, 9, 2, 1, "vo_minigame_1012_result_1090", "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300159, 4, 1, 2, 5.37, 0, 1, 2, 1, "vo_minigame_1012_result_1091", "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300160, 4, 1, 2, 1.44, 0, 1, 2, 1, "vo_minigame_1012_result_1092", "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300161, 4, 1, 2, 0.0, 0, 3, 3, 1, "vo_minigame_1012_result_1093", "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300162, 4, 1, 2, 2.91, 3, 9, 3, 1, "vo_minigame_1012_result_1094", "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 12300163, 4, 1, 2, 2.61, 0, 1, 3, 1, "vo_minigame_1012_result_1095", "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 12300164, 0, 1, 2, 3.63, 1, 2, 1, 0, "vo_minigame_1012_result_1096", "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 6, 12300165, 0, 1, 2, 4.16, 1, 2, 1, 0, "vo_minigame_1012_result_1097", "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300166, 0, 1, 2, 0.01, 6, 3, 1, 0, "vo_minigame_1012_result_1098", "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 6, 12300167, 0, 1, 2, 5.75, 0, 2, 2, 0, "vo_minigame_1012_result_1099", "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 12300168, 0, 1, 2, 5.64, 1, 2, 2, 0, "vo_minigame_1012_result_1100", "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 8, 12300169, 0, 1, 2, 5.73, 8, 4, 2, 0, "vo_minigame_1012_result_1101", "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 5, 12300170, 0, 1, 2, 5.32, 1, 3, 3, 0, "vo_minigame_1012_result_1102", "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 12300171, 0, 1, 2, 2.37, 9, 9, 3, 0, "vo_minigame_1012_result_1103", "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 12300172, 0, 1, 2, 4.25, 3, 1, 3, 0, "vo_minigame_1012_result_1104", "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！");
