INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 22300159, 4, 2, 2, 5.45, 0, 7, 2, 1, "vo_minigame_1012_result_2091", "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 22300160, 4, 2, 2, 4.29, 3, 10, 2, 1, "vo_minigame_1012_result_2092", "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 22300161, 4, 2, 2, 4.64, 6, 8, 3, 1, "vo_minigame_1012_result_2093", "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 22300162, 4, 2, 2, 3.14, 0, 5, 3, 1, "vo_minigame_1012_result_2094", "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 7, 22300163, 4, 2, 2, 6.59, 0, 4, 3, 1, "vo_minigame_1012_result_2095", "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 3, 22300164, 0, 2, 2, 0.0, 0, 3, 1, 0, "vo_minigame_1012_result_2096", "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 22300165, 0, 2, 2, 2.2, 5, 10, 1, 0, "vo_minigame_1012_result_2097", "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 22300166, 0, 2, 2, 0.01, 6, 4, 1, 0, "vo_minigame_1012_result_2098", "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 6, 22300167, 0, 2, 2, 2.8, 3, 2, 2, 0, "vo_minigame_1012_result_2099", "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 22300168, 0, 2, 2, 3.22, 6, 4, 2, 0, "vo_minigame_1012_result_2100", "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 22300169, 0, 2, 2, 2.1, 11, 0, 2, 0, "vo_minigame_1012_result_2101", "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 22300170, 0, 2, 2, 2.74, 3, 2, 3, 0, "vo_minigame_1012_result_2102", "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！");
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 6, 22300171, 0, 2, 2, 3.0, 9, 9, 3, 0, "vo_minigame_1012_result_2103", "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？");
